import React from "react";
import { HeaderFontPreview } from "./headerFont";
import { FontList } from "./fontList";
import {FontPreviewProps} from "./fontPreviewProps";

export const MasterPieceFont: React.FC<FontPreviewProps> = ({ previewText , fontSize, lineheight }) => {

    const fonts = [
        "MasterpieceCTL",
        "MasterpieceLakwel",
        "MasterpieceSpringRev",
        "MasterpieceStadium",
        "MasterpieceTawWin",
        "MasterpieceUniHand",
        "MasterpieceUniRound",
        "MasterpieceUniSerif",
        "MasterpieceUniType",
        "MasterpieceYayChanZin"
    ];

    return (
        <FontList title="Masterpieces Font Preview" previewText={previewText} fontSize={fontSize} data={fonts} lineheight={lineheight} />
    );
};
